/** @format */

import React, { Fragment, useState } from "react";

import {
  Box,
  FormLabel,
  FormControlLabel,
  Radio,
  RadioGroup,
  FormControl,
  Checkbox,
} from "@mui/material";

const InvoicePayment = () => {
  const [invoiceData, setInvoiceData] = useState({
    payment_method: "",
    contact: "",
    billable: false,
    date_range: "",
    create_date: "",
    due_date: "",
    template: "",
    invoice_no: "",
    discount: "",
    submit: false,
  });

  const {
    matter,
    contact,
    billable,
    date_range,
    create_date,
    due_date,
    template,
    invoice_no,
    discount,
    submit,
  } = invoiceData;
  const onChange = (e) =>
    setInvoiceData({ ...invoiceData, [e.target.name]: e.target.value });

  const onSubmit = (e) => {
    e.preventDefault();
  };
  return (
    <Fragment>
      <Box>
        <FormControl component="fieldset">
          <FormLabel component="legend">Gender</FormLabel>
          <RadioGroup
            aria-label="gender"
            defaultValue="female"
            name="radio-buttons-group"
          >
            <FormControlLabel
              value="female"
              control={<Checkbox />}
              label="Female"
            />
            <FormControlLabel
              value="male"
              control={<Checkbox />}
              label="Male"
            />
            <FormControlLabel
              value="other"
              control={<Checkbox />}
              label="Other"
            />
            <FormControlLabel
              value="other"
              control={<Checkbox />}
              label="Other"
            />
          </RadioGroup>
        </FormControl>
      </Box>
    </Fragment>
  );
};

export default InvoicePayment;
